package model;import io.realm.RealmObject;import io.realm.RealmResults;import io.realm.annotations.LinkingObjects;import io.realm.annotations.PrimaryKey;import io.realm.annotations.Required;//@Parcel(implementations = {model_UserRealmProxy.class})public class User extends RealmObject {    public User() {    }    /**     * <Fields>     *     * @see User#fbid                   {@link String}     * @see User#name                   {@link String}     */    //region Fields [fbid, name]    @PrimaryKey    private String fbid;    @Required    private String name;    //endregion    /**     * <LinkingObjects>     *     * @see Wallet#user     */    //region LinkingObjects [wallets]    @LinkingObjects("user")    private final RealmResults<Wallet> wallets = null;    //endregion    /**     * <Getter> & <Setter>     */    //region Getter & Setter    public String getFbid() {        return fbid;    }    public void setFbid(String fbid) {        this.fbid = fbid;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    //endregion}